const todos = [
  { id: 1, text: 'study', iscompleted: false },
  { id: 2, text: 'sleep', iscompleted: false },
  { id: 3, text: 'pray', iscompleted: false }
]
function App() {
  return (
    <div className="container">
      <Navbar />
      <TodoList />
